INSERT INTO `wp_options` VALUES (295,'cerber_admin_info','<h1>Highlights from WP Cerber Security 9.0</h1><ul><li>New: Different <a href=\"https://wpcerber.com/wordpress-notifications-made-easy/\" target=\"_blank\">alerts</a> can be sent through different channels. You can select delivering notifications through Pushbullet and email simultaneously, Pushbullet only, or email only. The settings are configured on a per-alert basis in the alert creation form.</li><li>New: Implemented a new &quot;Message format&quot; feature and setting. You can reduce the number of links in WP Cerbers messages or disable them completely to prevent sending sensitive data.</li><li>New: Implemented separate rate limiting settings for email and <a href=\"https://wpcerber.com/wordpress-mobile-and-browser-notifications-pushbullet/\" target=\"_blank\">Pushbullet notifications</a>.</li><li>New: Lockout notifications and appropriate threshold can be enabled for Pushbullet and emails separately.</li><li>New: Email reports and alerts can be sent via a separate SMTP server configured in the WP Cerber settings.</li><li>New: Implemented masking IP addresses and usernames (logins) in emails and mobile alerts.</li><li>New: Disabling login language switcher. If enabled, removes language switcher on the standard WordPress login page introduced in WordPress 5.9.</li></ul><p style=\"margin-top: 18px; line-height: 1.3;\"><span class=\"dashicons-before dashicons-info-outline\"></span>  &nbsp; <a href=\"https://wpcerber.com/?plugin_version=9.0\" target=\"_blank\">Read more on wpcerber.com</a></p>  <h2 style=\"margin-top: 28px;\">We need your support to keep moving forward</h2>\r\n                    <table style=\"margin-top: 20px;\"><tr><td></td><td style=\"padding-top: 0;\">By sharing your unique opinion on WP Cerber, you help the engineers behind the plugin make greater progress and help other professionals find the right software. You can leave your review on one of the following websites. Feel free to use your native language. Thanks!\r\n                    </td></tr></table>\r\n                       \r\n                    <p><a href=\"https://www.trustpilot.com/review/wpcerber.com\" target=\"_blank\">Leave review on Trustpilot</a>\r\n                    &nbsp;|&nbsp; \r\n                    <a href=\"https://www.g2.com/products/cerber-security-antispam-malware-scan/reviews/start\" target=\"_blank\">Leave review on G2.COM</a><p style=\"text-align:right; padding-right: 20px;\">\r\n    		    <input type=\"button\" class=\"button button-primary cerber-dismiss\" value=\" &nbsp; Awesome! &nbsp; \"/></p>','no');
